vector<int> e(90000);

int evaluate(int K, int L, int M) {
  if (K == L && L <= M) return 1;

  if (e[300*(M+1) + M+K] <= L) {
    for(int i = max(1, M - L + 1); i < M + 1; i++) {
      if (M - i + 1 + e[300*(M+1) + i+K-1] == L) return i;
    }
  }
  for(int i = M+1; i < MAX+1; i++) {
    if (e[300*i + i+K-1] == L) return i;
  }

  return d[(K-1)*50 + L];
}

int main() {
  for(auto p=primelist.begin(); p != primelist.end(); p++) {
    for(int i=0; i <= *p; i++) {
      for(int j=*p; j <= 2*MAX; j++) {
        e[300*i + j]++;
      }
    }
  }

  int Q, K, L, M;
  cin >> Q;
 
  for(int i=0; i < Q; i++) {
    cin >> K;
    cin >> L;
    cin >> M;
    cout << evaluate(K, L, M) << endl;
  }
}
